B.aiL=new A.hl("1. Introduction",'SolFight ("we", "us", "our") operates the SolFight platform (the "Service"), a competitive 1v1 trading arena built on the Solana blockchain. This Privacy Policy explains how we collect, use, disclose, and safeguard your information when you use our Service. By using SolFight, you consent to the practices described in this policy.')
B.aiP=new A.hl("2. Information We Collect","Wallet Address: When you connect your Solana wallet, we collect your public wallet address. This is required to facilitate deposits, match settlements, and withdrawals.\n\nOn-Chain Transaction Data: All match bets, settlements, and transfers are recorded on the Solana blockchain and are publicly visible.\n\nUsage Data: We collect anonymized usage analytics including pages visited, match history, features used, device type, browser type, and approximate geographic region.\n\nCommunications: If you contact us via email, Discord, or the feedback form, we retain the content of those communications to provide support.")
B.aip=new A.hl("3. Information We Do NOT Collect","We do not collect your real name, email address (unless you voluntarily provide it), phone number, government-issued ID, or any other personally identifiable information (PII). SolFight is designed to operate with wallet-based authentication only.")
