B.air=new A.hl("5. Data Sharing & Disclosure","We do not sell, rent, or share your personal information with third parties for marketing purposes. We may share data in the following circumstances:\n\n\u2022 Service Providers: Trusted third parties that help us operate the platform (e.g., analytics, hosting) under strict confidentiality agreements.\n\u2022 Legal Requirements: When required by law, regulation, or legal process.\n\u2022 Safety: To protect the rights, safety, or property of SolFight, our users, or the public.")
B.aiH=new A.hl("6. Blockchain Data","Transactions on the Solana blockchain are inherently public and immutable. Once recorded, on-chain data cannot be modified or deleted by SolFight or any party. Your wallet address and transaction history on-chain are visible to anyone.")
B.aiF=new A.hl("7. Cookies & Tracking","We use essential cookies to maintain session state and remember your preferences (e.g., wallet connection). We use anonymized analytics to understand aggregate usage patterns. We do not use advertising cookies or trackers.")
B.aiJ=new A.hl("8. Data Retention","We retain usage analytics and match history for as long as the Service is active. If you wish to delete your off-chain data, contact us at support@solfight.io. On-chain data cannot be deleted due to the nature of blockchain technology.")
B.aiE=new A.hl("9. Security","We implement industry-standard security measures including encrypted connections (HTTPS/TLS), secure smart contract architecture, and regular security audits. However, no system is 100% secure. You are responsible for safeguarding your wallet's private keys.")
B.aiu=new A.hl("10. Children's Privacy","SolFight is not intended for anyone under the age of 18. We do not knowingly collect information from minors. If we learn that we have collected data from a minor, we will take steps to delete it promptly.")
B.aiG=new A.hl("11. Changes to This Policy",'We may update this Privacy Policy from time to time. Changes will be posted on this page with an updated "Last updated" date. Continued use of the Service after changes constitutes acceptance of the revised policy.')
